INSERT INTO `articulos` (`id`, `numero`, `nombre`, `ley_id`) VALUES
(1, 100, 'Con el objeto de garantizar el cumplimiento de los principios constitucionales de\r\nlegalidad, objetividad, eficiencia, profesionalismo, honradez y respeto a los derechos humanos, los\r\nintegrantes de las Instituciones de Seguridad Pública tendrán, de conformidad con su adscripción a\r\nunidades de prevención, de reacción o de investigación, los derechos y obligaciones siguientes:', 2),
(2, 101, 'Siempre que se use la fuerza pública, se hará de manera racional, congruente,\r\noportuna y con respeto a los derechos humanos. Para tal efecto, los elementos de las Instituciones\r\nPoliciales deberán apegarse a los protocolos, las disposiciones normativas y administrativas\r\naplicables.\r\n', 2),
(3, 102, 'Las Instituciones de Seguridad Pública emitirán un documento de identificación a\r\ncada uno de sus integrantes, con las características siguientes:', 2),
(4, 182, 'La actuación de los Integrantes de las Instituciones Policiales se regirá por los\r\nprincipios previstos en los artículos 21 de la Constitución Federal, la Ley General y esta Ley.\r\nLa disciplina comprende el aprecio de sí mismo, la pulcritud, los buenos modales, el rechazo a los\r\nvicios, la puntualidad en el servicio, la exactitud en la obediencia, el escrupuloso respeto a las leyes y\r\nreglamentos, así como a los derechos humanos.\r\nLa disciplina es la base del funcionamiento y organización de las Instituciones Policiales, por lo que\r\nsus Integrantes deberán sujetar su conducta a la observancia de las leyes, órdenes y jerarquías, así\r\ncomo a la obediencia y al alto concepto del honor, de la justicia y de la ética.', 2),
(5, 152, 'La permanencia es el resultado del cumplimiento constante de los requisitos\r\nestablecidos en la presente Ley para continuar en el servicio activo de las Instituciones Policiales. Son\r\nrequisitos de ingreso y permanencia en las Instituciones Policiales, los siguientes:', 2);

