--
-- Volcado de datos para la tabla `catalogo_conductas`
--

INSERT INTO `catalogo_conductas` (`id`, `nombre`, `ley_id`, `articulo`, `seccion`, `fraccion_id`) VALUES
(1, 'La actuación de los Integrantes de las Instituciones Policiales se regirá por los\r\nprincipios previstos en los artículos 21 de la Constitución Federal, la Ley General y esta Ley.La disciplina comprende el aprecio de sí mismo, la pulcritud, los buenos modales, el rechazo a los vicios, la puntualidad en el servicio, la exactitud en la obediencia, el escrupuloso respeto a las leyes y\r\nreglamentos, así como a los derechos humanos.\r\nLa disciplina es la base del funcionamiento y organización de las Instituciones Policiales, por lo que\r\nsus Integrantes deberán sujetar su conducta a la observancia de las leyes, órdenes y jerarquías, así\r\ncomo a la obediencia y al alto concepto del honor, de la justicia y de la ética.\r\nLa disciplina demanda respeto y consideración mutua entre quien ostente un mando y sus\r\nsubordinados.', 2, 4, NULL, NULL),
(2, 'Siempre que se use la fuerza pública, se hará de manera racional, congruente, oportuna y con respeto a los derechos humanos. Para tal efecto, los elementos de las Instituciones Policiales  deberán  apegarse  a  los  protocolos,  las  disposiciones  normativas  y  administrativas aplicables.', 2, 2, NULL, NULL),
(3, 'I. Ser de notoria buena conducta, y no haber sido condenado por sentencia irrevocable por delito doloso;', 2, 5, NULL, NULL),
(4, 'II. Mantener actualizado su Certificado Único Policial;', 2, 5, NULL, NULL),
(5, 'III. No superar la edad máxima de retiro que establezcan las disposiciones aplicables;', 2, 5, NULL, NULL),
(6, 'IV. Acreditar que ha concluido, al menos, los estudios siguientes:', 2, 5, NULL, NULL),
(7, 'a) En el caso de integrantes de las áreas de investigación, enseñanza superior, equivalente u homologación por desempeño, a partir de bachillerato;', 2, 5, NULL, NULL),
(8, 'b) Tratándose de integrantes de las áreas de prevención, enseñanza media superior o equivalente; o', 2, 5, NULL, NULL),
(9, 'c) En caso de integrantes de las áreas de reacción, los estudios correspondientes a la enseñanza media básica.', 2, 5, NULL, NULL),
(10, 'V. Aprobar los cursos de formación, capacitación y profesionalización;', 2, 5, NULL, NULL),
(11, 'VI. Aprobar los procesos de evaluación de control de confianza;', 2, 5, NULL, NULL),
(12, 'VII. Aprobar las evaluaciones del desempeño;', 2, 5, NULL, NULL),
(13, 'VIII. Participar en los procesos de promoción o ascenso a que se convoque, conforme a las disposiciones aplicables;', 2, 5, NULL, NULL),
(14, 'IX. Abstenerse de consumir sustancias psicotrópicas, estupefacientes u otras que produzcan efectos similares;', 2, 5, NULL, NULL),
(15, 'X. No padecer alcoholismo;', 2, 5, NULL, NULL),
(16, 'XI. Someterse a exámenes para comprobar la ausencia de alcoholismo;', 2, 5, NULL, NULL),
(17, 'XII. Someterse a exámenes para comprobar la ausencia de sustancias psicotrópicas, estupefacientes u otras que produzcan efectos similares;', 2, 5, NULL, NULL),
(18, 'XIII. No estar suspendido o inhabilitado, ni haber sido destituido por resolución firme como servidor público en ningún ámbito de gobierno;', 2, 5, NULL, NULL),
(19, 'XIV. No ausentarse del servicio sin causa justificada, por un periodo de tres días consecutivos o de cinco días dentro de un término de treinta días; y', 2, 5, NULL, NULL),
(20, 'XV. Las demás que establezcan las disposiciones jurídicas aplicables.', 2, 5, NULL, NULL),
(21, 'I. Nombre del integrante de la Institución de Seguridad Pública; ', 2, 3, NULL, NULL),
(22, 'II. Cargo y nivel jerárquico;', 2, 3, NULL, NULL),
(23, 'III. Fotografía del integrante debidamente sellada en uno de sus extremos con las protecciones tecnológicas que se implementen para evitar su reproducción ilegal;', 2, 3, NULL, NULL),
(24, 'IV. Huella digital del integrante de la Institución de Seguridad Pública;', 2, 3, NULL, NULL),
(25, 'V. Clave de inscripción en el Registro Nacional de Personal de Seguridad Pública; ', 2, 3, NULL, NULL),
(26, 'VI. Firma del integrante;', 2, 3, NULL, NULL),
(27, 'VII.  Nombre,  cargo,  nivel  jerárquico  y  firma  del  servidor  público  que  emite  el  documento  de identificación; ', 2, 3, NULL, NULL),
(28, 'VIII. En su caso, señalar que el documento de identificación ampara la portación de arma de cargo, precisando los datos de la licencia oficial colectiva, en términos de las disposiciones aplicables.', 2, 3, NULL, NULL),
(29, 'I. Percibir la remuneración neta por el desempeño de su servicio, salvo las deducciones y descuentos que procedan en términos de Ley, que tenderá a ser un salario digno acorde con el servicio;', 2, 1, 'A. DERECHOS', NULL),
(30, 'II. Gozar de un trato digno y decoroso por parte de sus superiores jerárquicos, iguales o subalternos;', 2, 1, 'A. DERECHOS', NULL),
(31, 'III. Ser sujeto de los ascensos, condecoraciones, estímulos, recompensas y distinciones a que se hayan hecho merecedores, así como permanecer en el servicio de carrera en términos de las disposiciones legales correspondientes;', 2, 1, 'A. DERECHOS', NULL),
(32, 'IV. Recibir la formación, capacitación, adiestramiento y profesionalización;', 2, 1, 'A. DERECHOS', NULL),
(33, 'V. Recibir en forma gratuita el vestuario, municiones, armamento y equipo necesario para el desempeño de sus funciones;', 2, 1, 'A. DERECHOS', NULL),
(34, 'VI. Recibir asesoría legal en asuntos relacionados con el ejercicio de sus funciones;', 2, 1, 'A. DERECHOS', NULL),
(35, 'VII. Gozar de los beneficios y prestaciones de seguridad social en términos de las disposiciones legales aplicables;', 2, 1, 'A. DERECHOS', NULL),
(36, 'VIII. Ser recluido en lugares especiales cuando sea sujeto a prisión preventiva;', 2, 1, 'A. DERECHOS', NULL),
(37, 'IX. Acceder a las bibliotecas e instalaciones deportivas con que se cuente;', 2, 1, 'A. DERECHOS', NULL),
(38, 'X. Gozar de un seguro de vida, en términos de las disposiciones legales aplicables.', 2, 1, 'A. DERECHOS', NULL),
(39, 'a) Conducirse siempre con dedicación y disciplina, así como con apego al orden jurídico y respeto a los derechos humanos reconocidos en la Constitución Federal, en la Constitución Estatal y en los tratados internacionales suscritos por el Estado Mexicano;', 2, 1, 'A. OBLIGACIONES', NULL),
(40, 'b) Preservar la secrecía de los asuntos que por razón del desempeño de su función conozcan, en términos de las disposiciones aplicables;', 2, 1, 'A. OBLIGACIONES', NULL),
(41, 'c) Cumplir sus funciones con absoluta imparcialidad y sin discriminación alguna;', 2, 1, 'A. OBLIGACIONES', NULL),
(42, 'd) Observar un trato respetuoso con todas las personas, debiendo abstenerse de todo acto arbitrario y  de  limitar  indebidamente  las  acciones  o  manifestaciones  que  en  ejercicio  de  sus  derechos constitucionales y con carácter pacífico realice la población;', 2, 1, 'A. OBLIGACIONES', NULL),
(43, 'e) Velar por la integridad física y psicológica de las personas detenidas, ya sea por la probable comisión de un delito o de una falta administrativa;', 2, 1, 'A. OBLIGACIONES', NULL),
(44, 'f) Abstenerse en todo momento de infligir o tolerar actos de tortura, aún cuando se trate de una orden superior o se argumenten circunstancias especiales, tales como amenaza a la seguridad pública, urgencia de las investigaciones o cualquier otra; al conocimiento de ello, los denunciará inmediatamente ante la autoridad competente;', 2, 1, 'A. OBLIGACIONES', NULL),
(45, 'g) Desempeñar su misión sin solicitar ni aceptar compensaciones, pagos o gratificaciones distintas a las previstas legalmente. En particular se opondrán a cualquier acto de corrupción y en caso de tener conocimiento de alguno, deberán denunciarlo;', 2, 1, 'A. OBLIGACIONES', NULL),
(46, 'h) Utilizar los protocolos de investigación, de atención y demás que se establezcan para el desempeño de sus funciones, así como de cadena de custodia adoptados por las Instituciones de Seguridad Pública.', 2, 1, 'A. OBLIGACIONES', NULL),
(47, 'h) Utilizar los protocolos de investigación, de atención y demás que se establezcan para el desempeño de sus funciones, así como de cadena de custodia adoptados por las Instituciones de Seguridad Pública.', 2, 1, 'A. OBLIGACIONES', NULL),
(48, 'i) Participar en operativos y mecanismos de coordinación con otras Instituciones de Seguridad Pública, así como brindarles, en su caso, el apoyo que conforme a derecho proceda;', 2, 1, 'A. OBLIGACIONES', NULL),
(49, 'j) Abstenerse de disponer de bienes asegurados para beneficio propio o de terceros;', 2, 1, 'A. OBLIGACIONES', NULL),
(50, 'k) Preservar, conforme a las disposiciones aplicables, las pruebas e indicios de probables hechos delictivos o faltas administrativas de forma que no pierdan su calidad probatoria y se facilite la correcta tramitación del procedimiento correspondiente;', 2, 1, 'A. OBLIGACIONES', NULL),
(51, 'l)  Abstenerse  de  sustraer,  ocultar,  alterar  o  dañar  información  o  bienes  en  perjuicio  de  las Instituciones;', 2, 1, 'A. OBLIGACIONES', NULL),
(52, 'm) Abstenerse conforme a las disposiciones aplicables, de dar a conocer por cualquier medio a quien no tenga derecho, documentos, registros, imágenes, constancias, estadísticas, reportes o cualquier otra información reservada o confidencial de la que tenga conocimiento en ejercicio y con motivo de su empleo, cargo comisión;', 2, 1, 'A. OBLIGACIONES', NULL),
(53, 'n) Atender con diligencia las solicitudes de auxilio que se les formulen, o en su caso, turnarlo al área competente;', 2, 1, 'A. OBLIGACIONES', NULL),
(54, 'ñ) Abstenerse de introducir a las instalaciones de sus instituciones o consumir dentro o fuera de ellas   en   el   ejercicio   de   sus   funciones,   bebidas   embriagantes,   sustancias   psicotrópicas, estupefacientes  u  otras  sustancias  adictivas de carácter ilegal, prohibido o controlado. No  se sancionará  la  introducción  a  las  instalaciones  de  sus  instituciones  cuando  losmateriales  antes referidos  sean  producto  de  detenciones,  cateos,  aseguramiento  u  otros  similares  y  que  previamente exista la autorización correspondiente;', 2, 1, 'A. OBLIGACIONES', NULL),
(55, 'o) Abstenerse de realizar conductas que desacrediten su persona o la imagen de las Instituciones, dentro o fuera del servicio;', 2, 1, 'A. OBLIGACIONES', NULL),
(56, 'p) Evitar que personas ajenas a sus instituciones realicen actos inherentes a las atribuciones que tenga encomendadas. Asimismo, no podrá hacerse acompañar de dichas personas al realizar actos de servicio;', 2, 1, 'A. OBLIGACIONES', NULL),
(57, 'q) Abstenerse de instruir a sus subordinados la realización de actividades ajenas al servicio de seguridad pública;', 2, 1, 'A. OBLIGACIONES', NULL),
(58, 'r) Someterse  a  evaluaciones  periódicas  para  acreditar  el  cumplimiento  de  los  requisitos  de permanencia, así como obtener y mantener vigente la certificación respectiva;', 2, 1, 'A. OBLIGACIONES', NULL),
(59, 's) Informar  al  superior  jerárquico,  de  manera  inmediata,  las  omisiones,  actos  indebidos  o constitutivos de delito, de sus subordinados o iguales en categoría jerárquica;', 2, 1, 'A. OBLIGACIONES', NULL),
(60, 't) Cumplir y hacer cumplir con diligencia las órdenes que reciban con motivo del desempeño de sus funciones, evitando todo acto u omisión que produzca deficiencia en su cumplimiento;', 2, 1, 'A. OBLIGACIONES', NULL),
(61, 'u) Fomentar la disciplina, responsabilidad, decisión, integridad, espíritu de cuerpo y profesionalismo, en sí mismo y en el personal bajo su mando; y', 2, 1, 'A. OBLIGACIONES', NULL),
(62, 'v) Recibir denuncias anónimas e inmediatamente hacerlo del conocimiento del Ministerio Público a efecto de que este coordine la investigación;', 2, 1, 'A. OBLIGACIONES', NULL),
(63, 'w) Entrevistar a las personas que pudieran aportar algún dato o elemento para la investigación, bajo la conducción y mando del Ministerio Público;', 2, 1, 'A. OBLIGACIONES', NULL),
(64, 'x) En operativos, portar o utilizar únicamente los equipos de radiofrecuencia, de telefonía o cualquier otro dispositivo de comunicación que les hayan sido proporcionados por la Institución a la que pertenecen;', 2, 1, 'A. OBLIGACIONES', NULL),
(65, 'y) Realizar  sus  atribuciones  con  estricto  apego  a  las  disposiciones  normativas  con perspectiva de género.', 2, 1, 'A. OBLIGACIONES', NULL),
(66, 'z) Cumplir diligentemente los cambios de adscripción, que se deriven de las necesidades del servicio, conforme a las disposiciones legales en la materia; y', 2, 1, 'A. OBLIGACIONES', NULL),
(67, 'aa) Las demás que establezca esta Ley y otras disposiciones aplicables.', 2, 1, 'A. OBLIGACIONES', NULL),
(68, 'a) Prestar auxilio a las personas amenazadas por algún peligro o que hayan sido víctimas u ofendidos de algún delito, así como brindar protección a sus bienes y derechos. Su actuación será congruente, oportuna y proporcional al hecho, de conformidad con el marco jurídico aplicable en la materia;', 2, 1, 'A. OBLIGACIONES', NULL),
(69, 'b) Hacer  la  detención  de  personas  y  el  aseguramiento  de  bienes  que  se  encuentren relacionados  con  los  hechos probablemente constitutivos de delito en los supuestos que la Constitución Federal y las leyes determinan;', 2, 1, 'A. OBLIGACIONES', NULL),
(70, 'c) Inscribir de inmediato la detención que realice en el Registro Administrativo de Detenciones, así como remitir sin demora al detenido y los instrumentos, objetos o productos del delito asegurados y por cualquier medio la información al Ministerio Público;', 2, 1, 'A. OBLIGACIONES', NULL),
(71, 'd) Registrar en el Informe Policial Homologado los datos de las actividades e investigaciones que realice;', 2, 1, 'A. OBLIGACIONES', NULL),
(72, 'e) Reunir  la  información  que  pueda  ser  útil  para  acreditar  el  hecho  delictivo  y  la  autoría  o participación del imputado, conforme a las instrucciones del Ministerio Público;', 2, 1, 'A. OBLIGACIONES', NULL),
(73, 'f) Realizar la búsqueda de personas no localizadas, ausentes o extraviadas a petición de autoridad competente, e informar al Ministerio Público los resultados correspondientes;', 2, 1, 'A. OBLIGACIONES', NULL),
(74, 'g) Cumplir las medidas de protección ordenadas por el Ministerio Público;', 2, 1, 'A. OBLIGACIONES', NULL),
(75, 'h) Resguardar las unidades de investigación de los delitos y sus alrededores;', 2, 1, 'A. OBLIGACIONES', NULL),
(76, 'i) Obtener y mantener actualizado su Certificado Único Policial;', 2, 1, 'A. OBLIGACIONES', NULL),
(77, 'j) Obedecer las órdenes de los superiores jerárquicos o de quienes ejerzan sobre él funciones de mando cumpliendo con todas sus obligaciones, realizándolas conforme a derecho;', 2, 1, 'A. OBLIGACIONES', NULL),
(78, 'k) Responder al superior jerárquico correspondiente, sobre la ejecución de las órdenes directas que reciba, respetando reponderantemente la línea de mando;', 2, 1, 'A. OBLIGACIONES', NULL),
(79, 'l) Participar en operativos conjuntos con otras corporaciones policiales y con las unidades de la Fiscalía para la investigación de delitos;', 2, 1, 'A. OBLIGACIONES', NULL),
(80, 'm) Mantener en buen estado el armamento, material, municiones y equipo que se asigne con motivo de sus funciones, haciendo uso racional de ellos sólo en el desempeño del servicio y tomar las medidas necesarias para evitar su pérdida, extravío o deterioro;', 2, 1, 'A. OBLIGACIONES', NULL),
(81, 'n) Abstenerse de asistir uniformado a bares, cantinas, centros de apuestas y juegos, u otros lugares de este tipo, salvo aquellos casos derivados del ejercicio de su labor o cuando exista flagrancia;', 2, 1, 'A. OBLIGACIONES', NULL),
(82, 'ñ) Hacer uso de la fuerza pública, en cumplimiento de su deber, de manera racional, congruente, oportuna y con respeto a los derechos humanos;', 2, 1, 'A. OBLIGACIONES', NULL),
(83, 'o) Dar seguimiento a los sentenciados sujetos a sustitutivos penales o beneficios preliberacionales, en apoyo de la autoridad de reinserción social, e informar a la Fiscalía cuando existan indicios de delitos;', 2, 1, 'A. OBLIGACIONES', NULL),
(84, 'p) Realizar la investigación para la prevención de los delitos y vincular esas investigaciones con las relativas a los delitos;', 2, 1, 'A. OBLIGACIONES', NULL),
(85, 'q) Recibir las denuncias anónimas y de denunciante conocido, aún en casos sin flagrancia, sobre hechos que puedan ser constitutivos de delitos, en términos de lo dispuesto por el Código Nacional de Procedimientos Penales y las demás disposiciones aplicables;', 2, 1, 'A. OBLIGACIONES', NULL),
(86, 'r) i.  Prestar  protección  y  auxilio  inmediato,  de  conformidad  con  las  disposiciones  legales aplicables;', 2, 1, 'A. OBLIGACIONES', NULL),
(87, 'r) ii. Garantizar que reciban atención médica y psicológica cuando sea necesaria;', 2, 1, 'A. OBLIGACIONES', NULL),
(88, 'r) iii.  Adoptar las medidas que se consideren necesarias tendentes a evitar que se ponga en peligro su integridad física y psicológica, en el ámbito de su competencia;', 2, 1, 'A. OBLIGACIONES', NULL),
(89, 'r) iv.  Preservar los indicios y elementos de prueba que la víctima y ofendido aporten en el momento de la intervención policial y remitirlos sin demora al Ministerio Público encargado del asunto para que éste acuerde lo conducente, y', 2, 1, 'A. OBLIGACIONES', NULL),
(90, 'r) v.  Asegurar que puedan llevar a cabo la identificación del imputado sin riesgo para ellos.', 2, 1, 'A. OBLIGACIONES', NULL),
(91, 's) Incorporar la información conducente a las bases únicas de datos criminalísticos y de personal del Estado, y del Sistema Nacional de Información de Seguridad Pública, la información que pueda ser útil en la investigación de los delitos, y utilizar su cntenido para el desempeñode sus atribuciones, sin afectar el derecho de las personas sobre sus datos personales;', 2, 1, 'A. OBLIGACIONES', NULL),
(92, 't) Verificar la información que reciba sobre hechos que puedan ser constitutivos de delito para, si es constitutiva de un posible delito, remitirla al Ministerio Público;', 2, 1, 'A. OBLIGACIONES', NULL),
(93, 'u) Preservar el lugar de los hechos y la integridad de los indicios, huellas o vestigios del hecho delictuoso, así como los instrumentos, objetos o productos del delito, dando aviso de inmediato al Ministerio Público;', 2, 1, 'A. OBLIGACIONES', NULL),
(94, 'v) Asentar registro de cada una de sus actuaciones, así como llevar un control y seguimiento de éstas', 2, 1, 'A. OBLIGACIONES', NULL),
(95, 'w) Apoyar, y si tiene las capacidades, participar en el procesamiento del lugar de los hechos, en el que deberá fijar, señalar, levantar, embalar y entregar la evidencia física al Ministerio Público, conforme a los criterios previamente establecido por el Fiscal General y en términos de las disposiciones aplicables;', 2, 1, 'A. OBLIGACIONES', NULL),
(96, 'x) Solicitar al Ministerio Público que requiera a las autoridades competentes, informes y documentos para fines de la investigación, y en caso de incumplimiento, solicitar la imposición de medidas de apremio;', 2, 1, 'A. OBLIGACIONES', NULL),
(97, 'y) Practicar las investigaciones necesarias que permitan aclarar los hechos y la identidad de los imputados, informando de inmediato al Ministerio Público para su conducción jurídica;', 2, 1, 'A. OBLIGACIONES', NULL),
(98, 'z) Emitir los informes, partes policiales y demás documentos que se requieran por el Ministerio Público para la investigación, con los requisitos de fondo y forma que establezcan las disposiciones aplicables, para tal efecto se podrán apoyar en los conocimientos que resulten necesarios;', 2, 1, 'A. OBLIGACIONES', NULL),
(99, 'aa) Entrevistar a las personas que pudieran aportar algún dato o elemento para la investigación en caso de flagrancia o denuncia, en términos de las disposiciones aplicables. De las entrevistas que se practiquen se dejará constancia y se utilizarán como un registro de la investigación;', 2, 1, 'A. OBLIGACIONES', NULL),
(100, 'ab) Registrar en los sistemas informáticos institucionales toda la información de su actuación o conocimiento para su explotación, y proponer al Ministerio Público estrategias de sistematización de la investigación para los casos de su competencia;', 2, 1, 'A. OBLIGACIONES', NULL),
(101, 'ac) Realizar, a través del personal autorizado, las investigaciones de los delitos cometidos, así como las actuaciones que le solicite el Ministerio Público o la autoridad jurisdiccional conforme a las normas aplicables;', 2, 1, 'A. OBLIGACIONES', NULL),
(102, 'ad) Coordinarse con el agente del Ministerio Público que dirija la investigación y apoyarlo siempre que lo solicite, así como a las diversas unidades de la Fiscalía, para el esclarecimiento de los hechos, proteger a las víctimas y apoyar en la persecución del imputado;', 2, 1, 'A. OBLIGACIONES', NULL),
(103, 'ae) Integrar grupos de investigación delictiva con el personal de la Fiscalía, conforme la instrucción superior;', 2, 1, 'A. OBLIGACIONES', NULL),
(104, 'af) Dar  cumplimiento  a  las  órdenes  de  aprehensión,  comparecencia  y  presentación,  y  demás mandatos ministeriales y jurisdiccionales de que le sean asignados, y', 2, 1, 'A. OBLIGACIONES', NULL),
(105, 'ag) Las demás que establezca esta Ley y otras disposiciones aplicables.', 2, 1, 'A. OBLIGACIONES', NULL),
(106, 'La permanencia es el resultado del cumplimiento constante de los requisitos\r\nestablecidos en la presente Ley para continuar en el servicio activo de las Instituciones Policiales. Son\r\nrequisitos de ingreso y permanencia en las Instituciones Policiales, los siguientes:', 2, 5, NULL, NULL);

